import React from 'react';
import { Link } from 'react-router-dom';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faSignOutAlt } from '@fortawesome/free-solid-svg-icons';

const Sidebar = () => {
  return (
    <div className="bg-gray-800 min-h-screen w-64 p-4 flex flex-col justify-between">
      <nav>
        <Link to="/" className="text-white block py-2 hover:bg-gray-700 rounded">Dashboard</Link>
        <Link to="/products" className="text-white block py-2 hover:bg-gray-700 rounded">Products</Link>
        <Link to="/brands" className="text-white block py-2 hover:bg-gray-700 rounded">Brands</Link>
        <Link to="/categories" className="text-white block py-2 hover:bg-gray-700 rounded">Categories</Link>
        <Link to="/orders" className="text-white block py-2 hover:bg-gray-700 rounded">Orders</Link>
        <Link to="/coupons" className="text-white block py-2 hover:bg-gray-700 rounded">Coupons</Link>
        <Link to="/settings" className="text-white block py-2 hover:bg-gray-700 rounded">Settings</Link>
        <Link to="/signup" className="text-white block py-2 hover:bg-gray-700 rounded">Sign Up</Link>
      </nav>
      <div className="mt-auto">
        <Link to="/logout" className="text-white flex items-center py-2 hover:bg-gray-700 rounded">
          <FontAwesomeIcon icon={faSignOutAlt} className="mr-2" /> Logout
        </Link>
      </div>
    </div>
  );
};

export default Sidebar;
